   tmp_soil_funct <- dplyr::left_join(tmp_div, tmp_sub_soil_funct, by = "SampleID")
   tmp_soil_funct <- tmp_soil_funct %>% tibble::column_to_rownames("SampleID")      
## temp_adapt
