                    taxonomy_loaded = its18_select_mc$taxonomy_loaded,
                    edaphic = tmp_edaphic, 
                    soil_funct = tmp_soil_funct, 
                    temp_adapt = tmp_temp_adapt)
   tmp_name <- purrr::map_chr(i, ~ paste0(., "_split"))
